import { Button, Grid, Typography, makeStyles, Paper } from '@material-ui/core';
import { PersonAdd } from '@material-ui/icons';
import React from 'react';

const useStyles = makeStyles((theme) => ({
    
}));

const OurFocus = () => {
    const classes = useStyles();
    return (
        <>
        <div style={{height: '90vh', paddingLeft: '10%', paddingRight: '10%'}}>
            <Typography variant="h3" style={{paddingTop: '10vh', color: 'rgb(0, 13, 65)', fontWeight: 'bold'}}>
                Our Focuses
            </Typography>
            <Typography variant="body2" style={{fontSize: '24px'}}>
                We are actively collecting resources for other areas of business that members maybe interested, such as <h style={{color: 'pink', fontWeight: 'bold'}}>Marketing, Administration, Data Science, Entrepreneurship,</h> etc. If you have any suggestions, feel free to submit them!
            </Typography>
            <br/>
            
            <Paper square style={{borderStyle: 'solid', borderColor: 'pink'}} elevation={2}>
            <PersonAdd color="primary" fontSize="large" align="center"/>
            <Typography variant="h6">
                Investment Banking
            </Typography>
            <Typography variant="body2">
                Sign up here to become a general member by filling out our google form below:
            </Typography>
        </Paper>

        
        </div>
        </>
    )
}

export default OurFocus
